import { useEffect } from "react";
import { useDispatch } from "react-redux";
import { getLogs } from "../../actions/logs";

const LogItem = ({log}, key) => {
    const dispatch = useDispatch()
    function renderSwitch (subjtype) 
        {
            switch(subjtype)
            {
                case "Сотрудник":
                    return log.subject.first_name
                default:
                return log.subjid
            }
            
        }
    return (
        
    <tr key={key}>
        <td>{log.subjtype}</td>
        
        <td>{renderSwitch(log.subjtype)}</td>
        <td>{log.act}</td>
        <td>{log.objtype}</td>
        <td>{log.objid}</td>
    </tr>
    );
};

export default LogItem ;
